import { createSwapy } from 'swapy';
import * as Swapy from 'swapy';

function TodoItem({ text, completed, swapy }) {
  // Crea una instancia de Swapy o utiliza `createSwapy` según tus necesidades.
  const swapyInstance = createSwapy(swapy); // Ajusta según los parámetros necesarios
  console.log(Swapy);
  const handleSwapy = () => {
    swapyInstance.someMethod(); // Llama al método necesario en tu caso
  };

  return (
    <li
      className={`li_todos ${completed ? "completed" : ""}`}
      data-swapy-item={swapy}
      onClick={handleSwapy}
    >
      <span className={`span_accion ${completed ? "completedItem" : ""}`}>V</span>
      <p>{text}</p>
      <span className="span_accion deleteItem">X</span>
    </li>
  );
}

export { TodoItem };
